import Subjects from './Subjects'
class Quiz extends React.Component {
    state={
        subject:null
    }
    render() {
      return (
        <List >
        {Subjects.map((subject) =>
          subject.usage === "Primary" ? (
            <ListItem
            key={subject.name}
            color="blue"
              button
              onClick={() => executeScroll(subject.name)}
            >
              <ListItemText primary={subject.name} />
            </ListItem>
          ) : subject.usage === "Working" ? 
          <ListItem
              key={subject.name}

              className={subject.name===this.state.subject?classes.root:null}
              button
            >
              <ListItemText primary={subject.name} />
            </ListItem> :null
        )}
      </List>
      );
    }
  }
  export default Quiz
